import { Link } from 'react-router-dom';
import React from 'react';

function Navbar() {
    return ( 
        <div>
        <nav className='navbar'>
        <div className="row">
      <div className="col">
        <h1>FOOD APP</h1>
      </div>
      </div>
                  <div className='links'>
                <Link to="/">Home</Link>
                <Link to="/home">Home</Link>
                <Link to="/login">LoginPage</Link>
                <Link to="/loggedIn">AfterLogin</Link>
            </div>
        </nav>
        {/* <Outlet /> */}
        </div>
     );
}

export default Navbar;
